import React from 'react';
import './Homepage.css';
import { useNavigate } from 'react-router-dom';
import Navbar from '../../components/Navbar/Navbar';

import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function HomePage() {
  let navigate = useNavigate();

  const videos = [
    { url: 'https://www.youtube.com/embed/Vhtmu2osUmE', title: 'Video 1' },
    { url: 'https://www.youtube.com/embed/N5lkJ6aBWe4', title: 'Video 2' },
    { url: 'https://www.youtube.com/embed/bL7VReeCWqI', title: 'Video 3' },
    { url: 'https://www.youtube.com/embed/bL7VReeCWqI', title: 'Video 4' },
    { url: 'https://www.youtube.com/embed/bL7VReeCWqI', title: 'Video 5' },
    { url: 'https://www.youtube.com/embed/bL7VReeCWqI', title: 'Video 6' },
    // Add more videos here
  ];

  const handleClick = () => {
    const isLoggedIn = localStorage.getItem('isLoggedIn') === 'true';

    if (isLoggedIn) {
      navigate('/prediction');
    } else {
      toast.error('Please login or sign up first', {
        autoClose: 1000,
      });
    }
  };

  return (
    <>
      <Navbar />

      <div className="t-wrapper" id="SeasonalPicks">
        <div className="left">
          <div>
            <ul id="sideBar">
              <li>
                <a href="/" className="active">
                  <i className="fas fa-play fa-xs" style={{ color: 'white', marginRight: '5px' }}></i>
                  Live
                </a>
              </li>
              <li>
                <i className="fas fa-tv fa-xs" style={{ color: 'white', marginRight: '5px' }}></i>
                <a href="index.html">Channel</a>
              </li>
              <li>
                <i className="fas fa-clock fa-xs" style={{ color: 'white', marginRight: '5px' }}></i>
                <a href="index.html">Latest</a>
              </li>
              <li>
                <i className="fas fa-cog fa-xs" style={{ color: 'white', marginRight: '5px' }}></i>
                <a href="index.html">Setting</a>
              </li>
            </ul>
          </div>
        </div>

        <div className="right">
          {/* Embed YouTube videos */}
          <div className="video-wrapper">
            {videos.map((video, index) => (
              <div key={index} className="video-container">
                <iframe
                  width="582"
                  height="315"
                  src={video.url}
                  title={`YouTube video player ${index}`}
                  frameBorder="0"
                  allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
                  allowFullScreen
                ></iframe>
                <div className="video-title">{video.title}</div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </>
  );
}

export default HomePage;
